import './Mumbai.css';

function Mumbai() {
    const itinerary = [
      {
        day: 'Day 1',
        activities: [
          'Visit the Gateway of India',
          'Explore Chhatrapati Shivaji Terminus',
          'Stroll along Marine Drive',
        ],
      },
      {
        day: 'Day 2',
        activities: [
          'Explore Elephanta Caves',
          'Shop at Colaba Causeway',
          'Visit the Chhatrapati Shivaji Maharaj Vastu Sangrahalaya (Museum)',
        ],
      },
      {
        day: 'Day 3',
        activities: [
          'Enjoy the street food at Juhu Beach',
          'Take a walk at Bandra-Worli Sea Link',
          'Visit Siddhivinayak Temple',
        ],
      },
      {
        day: 'Day 4',
        activities: [
          'Experience Bollywood at Film City',
          'Shop at Linking Road, Bandra',
          'Dine at a local seafood restaurant',
        ],
      },
    ];

    return (
      <div className="mumbai-itinerary">
        <h1>Welcome to Mumbai</h1>
        {itinerary.map((day, index) => (
          <div key={index} className="itinerary-day">
            <h2>{day.day}</h2>
            <ul>
              {day.activities.map((activity, activityIndex) => (
                <li key={activityIndex}>{activity}</li>
              ))}
            </ul>
          </div>
        ))}
        <p className="footer">Enjoy your trip to Mumbai!</p>
      </div>
    );
  }

  export default Mumbai;
